import React from 'react';

const Logout = ({ onLogout }) => {
  const handleLogout = () => {
    // Lakukan proses logout, seperti menghapus token dan mengupdate state
    localStorage.removeItem('token'); // Contoh menghapus token
    onLogout(); // Panggil fungsi logout yang diberikan sebagai prop
  };

  return (
    <button
      onClick={handleLogout}
      className="bg-red-500 text-white py-2 px-4 rounded hover:bg-red-600"
    >
      Logout
    </button>
  );
};

export default Logout;
